const PCOLORS=["#f77189","#bb9832","#50b131","#36ada4","#3ba3ec","#e866f4"];class Bar{constructor(t,e,n,l,o,i,a){this.id=t;this.name=e;this.x_label=n;this.y_label=l;this.labels=o;this.values=i;this.log_toggle=a}}class MultiBar{constructor(t,e,n,l,o,i,a){this.id=t;this.names=e;this.x_label=n;this.y_label=l;this.labels=o;this.values=i;this.log_toggle=a}}class Hexbin{constructor(t,e,n,l,o){this.id=t;this.min=e;this.max=n;this.radius=l;console.time("bin");this.bins=o.map(function(t){var e=t.points;e.x=t.x;e.y=t.y;return e});console.timeEnd("bin")}}function buildPlotDownload(e,n,l){document.getElementById("btn-download-plot-"+n).onclick=function(){var t=document.createElement("a");t.href=e.toBase64Image();t.download=l+"_"+n+".png";t.click()}}function buildTableDownload(n,t,l){document.getElementById("btn-download-table-"+t).onclick=function(){let t=new Blob([n],{type:"text/plain"});var e=document.createElement("a");e.href=URL.createObjectURL(t);e.download=l+"_table.tsv";e.click()}}function buildLogToggle(e,t){document.getElementById("btn-logscale-plot-"+t).addEventListener("change",function(t){if(t.currentTarget.checked){e.options.scales.y.type="logarithmic"}else{e.options.scales.y.type="linear"}e.update()})}
